import React, { Component } from 'react'
import './card.css'
export default class card extends Component {
  render() {
      const {data}=this.props;
    return (
        <div className="cardwrapper">

        {data.map((x)=>
        <div className="card">
        </div>
        )}
      </div>

    )
  }
}
